import { forwardRef } from 'react';

const Writing = forwardRef((props, ref) => {
    return (
        <div ref={ref} className='writing'>
            <h3>{props.writingTitle}</h3>
            <p>{props.writingContent}</p>
        </div>
    );
});

export default Writing;
